    internal static class Ext
    {
        internal static float f32(this byte[] b, int o) => BitConverter.ToSingle(b, o);
        internal static uint u32(this byte[] b, int o) => BitConverter.ToUInt32(b, o);
        internal static int i32(this byte[] b, int o) => ((sbyte)b[o + 3] << 24) + ((int)b[o + 2] << 16) + ((int)b[o + 1] << 8) + b[o];
        internal static short i16(this byte[] b, int o) => (short)((b[o + 1] << 8) + b[o]);
    }
    public class TGraphicsTestsBase
    {
        [DllImport("User32.dll")]
        static extern IntPtr GetDC(IntPtr hwnd);

        // Erstelle kommentierte Version der nachfolgenden Methode.
        // 
        protected Graphics GraphicsWriter(Stream metaStream)
        {
            var bm = new Bitmap(1, 1);
            bm.SetResolution(96, 96);
            Graphics grfx = Graphics.FromImage(bm);
            IntPtr ipHdc = grfx.GetHdc();
            var mf = new Metafile(metaStream, ipHdc);
            grfx.ReleaseHdc(ipHdc);
            grfx.Dispose();

            var result = Graphics.FromImage(mf);
            result.Flush();
            return result;
        }

        protected void DrawToScreen(Image ig, Rectangle? r = null)
        {
            using (Graphics g = Graphics.FromHdc(GetDC(IntPtr.Zero)))
            {
                if (r == null)
                    r = new Rectangle(0, 0, ig.Width, ig.Height);
                g.DrawImage(ig, (Rectangle)r);
            }
        }

        protected string MfToProtocoll(Metafile mf)
        {
            string result = "";
            var mfh = mf.GetMetafileHeader();
            result += $"H:t{mfh.Type},v{mfh.Version},b{mfh.Bounds}"; // ,dpi({mfh.DpiX:0.0};{mfh.DpiY:0.0})";
            var bm = new Bitmap(mf.Width, mf.Height);
            bm.SetResolution(96, 96);
            Graphics grfx = Graphics.FromImage(bm);
            try
            {
                grfx.EnumerateMetafile(mf, Point.Empty, emfCallback);
            }
            catch { }
            return result;

            bool emfCallback(EmfPlusRecordType recordType, int flags, int dataSize, IntPtr data, PlayRecordCallback callbackData)
            {
                byte[]? _data = null;
                if (data != IntPtr.Zero &&
                    recordType != EmfPlusRecordType.EmfMin)
                {
                    _data = new byte[dataSize];
                    Marshal.Copy(data, _data, 0, dataSize);
                }
                result += Environment.NewLine + recordType switch
                {
                    EmfPlusRecordType.FillEllipse => FillEllipseRecord(flags, _data),
                    EmfPlusRecordType.FillRects => FillRectsRecord(flags, _data),
                    EmfPlusRecordType.FillPolygon => FillPolygonRecord(flags, _data),
                    EmfPlusRecordType.DrawEllipse => DrawEllipseRecord(flags, _data),
                    EmfPlusRecordType.DrawRects => DrawRectsRecord(flags, _data),
                    EmfPlusRecordType.DrawLines => DrawLinesRecord(flags, _data),
                    EmfPlusRecordType.DrawString => DrawStringRecord(flags, _data),
                    _ => $"R:{recordType},{flags:X},({(_data == null ? null : Convert.ToBase64String(_data))})"
                };
                return true;
            }
        }

        private static string FillEllipseRecord(int flags, byte[]? _data)
        {
            bool xCompressed = (flags & 0x4000) != 0;
            int iObjID = flags & 0x3F;

            if (_data?.Length == 12)
                return $"R:FillEllipse,O:{iObjID},#{_data.u32(0):X},({_data.i16(4)};{_data.i16(6)};{_data.i16(8)};{_data.i16(10)})";
            else
                return $"R:FillEllipse,O:{iObjID},({(_data == null ? null : Convert.ToBase64String(_data))})";
        }

        private static string FillRectsRecord(int flags, byte[]? _data)
        {
            bool xCompressed = (flags & 0x4000) != 0;
            int iObjID = flags & 0x3F;

            if (_data?.Length >= 16)
            {
                var iCnt = _data.i32(4);
                var sP = "";
                for (var i = 0; i < iCnt; i++)
                    sP += ((i == 0) ? "" : ",") + $"({_data.i16(8 + i * 8)};{_data.i16(10 + i * 8)};{_data.i16(12 + i * 8)};{_data.i16(14 + i * 8)})";

                return $"R:FillRects,O:{iObjID},#{_data.u32(0):X},({sP})";
            }
            else
                return $"R:FillRects,O:{iObjID},({(_data == null ? null : Convert.ToBase64String(_data))})";
        }

        private static string FillPolygonRecord(int flags, byte[]? _data)
        {
            bool xCompressed = (flags & 0x4000) != 0;
            int iObjID = flags & 0x3F;

            if (_data?.Length == 12)
                return $"R:FillPolygon,O:{iObjID},{_data.i32(0)},({_data.i16(4)};{_data.i16(6)};{_data.i16(8)};{_data.i16(10)})";
            else
                return $"R:FillPolygon,O:{iObjID},({(_data == null ? null : Convert.ToBase64String(_data))})";
        }

        private static string DrawEllipseRecord(int flags, byte[]? _data)
        {
            bool xCompressed = (flags & 0x4000) != 0;
            int iObjID = flags & 0x3F;

            if (_data?.Length == 8)
                return $"R:DrawEllipse,O:{iObjID},({_data.i16(0)};{_data.i16(2)};{_data.i16(4)};{_data.i16(6)})";
            else
                return $"R:DrawEllipse,O:{iObjID},({(_data == null ? null : Convert.ToBase64String(_data))})";
        }
        private static string DrawLinesRecord(int flags, byte[]? _data)
        {
            bool xCompressed = (flags & 0x4000) != 0;
            bool xFill = (flags & 0x2000) != 0;
            bool xAbs = (flags & 0x400) != 0;

            int iObjID = flags & 0x3F;

            if (_data?.Length > 11)
            {
                var iCnt = _data.i32(0);
                var sP = "";
                for (var i = 0; i < iCnt; i++)
                    sP += ((i == 0) ? "" : ",") + $"({_data.i16(4 + i * 4)};{_data.i16(6 + i * 4)})";
                return $"R:DrawLines,F:{xFill},O:{iObjID},({sP})";
            }
            else
                return $"R:DrawLines,O:{iObjID},({(_data == null ? null : Convert.ToBase64String(_data))})";
        }
        private static string DrawRectsRecord(int flags, byte[]? _data)
        {
            bool xCompressed = (flags & 0x4000) != 0;
            bool xFill = (flags & 0x2000) != 0;
            bool xAbs = (flags & 0x400) != 0;

            int iObjID = flags & 0x3F;

            if (_data?.Length > 11)
            {
                var iCnt = _data.i32(0);
                var sP = "";
                for (var i = 0; i < iCnt; i++)
                    sP += ((i == 0) ? "" : ",") + $"({_data.i16(4 + i * 8)};{_data.i16(6 + i * 8)};{_data.i16(8 + i * 8)};{_data.i16(10 + i * 8)})";
                return $"R:DrawRects,F:{xFill},O:{iObjID},({sP})";
            }
            else
                return $"R:DrawRects,O:{iObjID},({(_data == null ? null : Convert.ToBase64String(_data))})";
        }
        private static string DrawStringRecord(int flags, byte[]? _data)
        {
            bool xBrush = (flags & 0x8000) != 0;
            int iObjID = flags & 0x3F;

            if (_data?.Length > 31)
            {
                int iLen = _data.i32(8);
                string s = "";
                for (var i = 0; i < iLen && i * 2 + 28 < _data.Length; i++)
                    s += (char)_data.i16(28 + i * 2);
                RectangleF r = new RectangleF(_data.f32(12), _data.f32(16), _data.f32(20), _data.f32(24));
                return $"R:DrawString,O:{iObjID},({(xBrush ? Color.FromArgb(_data.i32(0)).ToString() : _data.i32(0).ToString())};{_data.i32(4)};{_data.i32(12)};{r};'{s}')";
            }
            else
                return $"R:DrawString,O:{iObjID},({(_data == null ? null : Convert.ToBase64String(_data))})";
        }

    }

